import React from "react";
import styled from "styled-components";

const SideBar = () => {
  return (
    <>
      <SideBarWrapper>
        {PAGE_LIST.map((page, i) => {
          return (
            <PageList key={i}>
              <span key={i}>{page.pageNum}</span>
            </PageList>
          );
        })}
      </SideBarWrapper>
    </>
  );
};

export default SideBar;

const SideBarWrapper = styled.div`
  width: 300px;
  height: 100vh;
  border-right: 1px solid lightgray;
  flex-direction: column;
`;

const PageList = styled.div`
  font-size: 18px;
  font-weight: bold;
  padding-left: 20px;
  span {
    height: 25px;
  }
`;

const PAGE_LIST = [
  { id: 1, pageNum: "page 1" },
  { id: 2, pageNum: "page 2" },
  { id: 3, pageNum: "page 3" },
];
